Actionscript.script:
if(_root.控制目标全自动 == true and _root.控制目标 == _parent._name)
{
   _parent.随机切换攻击模式();
}
_parent.动画完毕();

onClipEvent(load){
   function 子弹表演()
   {
      var _loc3_ = {x:_parent.枪.枪.装扮.枪口位置._x,y:_parent.枪.枪.装扮.枪口位置._y};
      _parent.枪.枪.装扮.localToGlobal(_loc3_);
      if(_loc3_.y == _parent.枪.枪.装扮.枪口位置._y)
      {
         _parent._parent.动画完毕();
      }
      _root.gameworld.globalToLocal(_loc3_);
      _parent.shootX = _loc3_.x;
      _parent.shootY = _loc3_.y;
      if(_parent.shootX != undefined)
      {
         _root.子弹区域shoot表演(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,_parent.shootX,_parent.shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
      }
   }
   计时开始 = getTimer();
   射击速度 = _parent._parent.手枪2属性.interval;
   手枪2是否单发 = _parent._parent.手枪2属性.singleshoot;
   弹夹容量 = _parent._parent.手枪2属性.capacity;
   使用弹夹名称 = _parent._parent.手枪2属性.clipname;
   声音 = _parent._parent.手枪2属性.sound;
   霰弹值 = _parent._parent.手枪2属性.split;
   子弹散射度 = _parent._parent.手枪2属性.diffusion;
   发射效果 = _parent._parent.手枪2属性.muzzle;
   子弹种类 = _parent._parent.手枪2属性.bullet;
   子弹威力 = _parent._parent.手枪2属性.power;
   子弹速度 = _parent._parent.手枪2属性.velocity;
   击中地图效果 = _parent._parent.手枪2属性.bullethit;
   Z轴攻击范围 = _parent._parent.手枪2属性.bulletsize;
   击倒率 = _parent._parent.手枪2属性.impact;
   击中后子弹的效果 = _parent._parent.手枪2属性.targethit;
   子弹敌我属性 = true;
   子弹表演();
}
onClipEvent(unload){
   _parent._parent.手枪2射击ing = false;
}
onClipEvent(enterFrame){
   计时中 = getTimer();
   if(计时中 - 计时开始 >= 射击速度)
   {
      子弹表演();
      计时开始 = getTimer();
   }
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
